func (e *geo_s2_encoder) writeUint64(x uint64) {
	if e.err != nil {
		return
	}
	e.err = binary.Write(e.w, binary.LittleEndian, x)
}

func (ci geo_s2_CellID) Encode(w io.Writer) error {
	e := &geo_s2_encoder{w: w}
	ci.encode(e)
	return e.err
}
